          {" "}
          <a href="https://webmastershisar.com/wp-content/uploads/2017/03/wmh9.png">
            Logo
          </a>
        </div>
        <div>
          <h1>Hello Style!</h1>
          <p>Add a little style!.</p>
        </div>
      </>
    );
  }
}
export default MyHeader;
